func TestRasterObstructed(t *testing.T) {
	floor := &Floor{
		Bounds: Polygon{
			Point{X: 0, Y: 0},
			Point{X: 2, Y: 1},
			Point{X: 3, Y: 4},
			Point{X: 1, Y: 3},
			Point{X: 0, Y: 5},
			Point{X: -4, Y: -2},
			Point{X: 0, Y: 1},
			Point{X: 0, Y: 0},
		},
		Obstacles: []Polygon{
			Polygon{
				Point{X: 0, Y: 2},
				Point{X: -1, Y: 2},
				Point{X: -1, Y: 1.5},
			},
			Polygon{
				Point{X: 1, Y: 3},
				Point{X: 1, Y: 4},
				Point{X: -1, Y: 4},
				Point{X: -1, Y: 3},
			},
		},
	}
	conn := NewRaster(floor)

	testPoints := []Point{
		Point{X: 1, Y: 0},
		Point{X: 1, Y: 1},
		Point{X: -0.9, Y: 1.9},
		Point{X: -0.1, Y: 1.7},
		Point{X: 0, Y: 3.5},
		Point{X: 0, Y: 2.5},
	}
	expected := []bool{
		true,
		false,
		true,
		false,
		true,
		false,
	}

	for i, exp := range expected {
		actual := conn.Obstructed(testPoints[i])
		if actual != exp {
			t.Errorf("case %d: expected %v but got %v", i, exp, actual)
		}
	}
}

func TestRasterUnobstructEdgeCase(t *testing.T) {
	floor := &Floor{
		Bounds: Polygon{
			Point{X: 0, Y: 0},
			Point{X: 2, Y: 1},
			Point{X: 3, Y: 4},
			Point{X: 1, Y: 3},
			Point{X: 0, Y: 5},
			Point{X: -4, Y: -2},
			Point{X: 0, Y: 1},
			Point{X: 0, Y: 0},
		},
		Obstacles: []Polygon{
			Polygon{
				Point{X: 0, Y: 2},
				Point{X: -1, Y: 2},
				Point{X: -1, Y: 1.5},
			},
			Polygon{
				Point{X: 1, Y: 3},
				Point{X: 1, Y: 4},
				Point{X: -1, Y: 4},
				Point{X: -1, Y: 3},
			},
		},
	}
	conn := NewRaster(floor)
	if conn.Obstructed(conn.Unobstruct(Point{X: -5, Y: -3})) {
		t.Error("failed to unobstruct point")
	}
}

func TestRasterConnectBatch(t *testing.T) {
	var floor *Floor
	essentials.Must(json.Unmarshal([]byte(connectorFloorData), &floor))

	start := floor.Zone("D10").Location
	ends := []Point{
		floor.Zone("B19").Location,
		floor.Zone("D8").Location,
		floor.Zone("CL13").Location,
		floor.Zone("womens").Location,
	}

	raster := NewRaster(floor)

	actuals := raster.ConnectBatch(start, ends)
	for i, actual := range actuals {
		expected := raster.Connect(start, ends[i])
		if len(actual) != len(expected) {
			t.Errorf("mismatched length at index %d", i)
		} else {
			for j, a := range actual {
				x := expected[j]
				if a != x {
					t.Errorf("mismatched path at index %d", i)
					break
				}
			}
		}
	}
}

func TestRasterConnectSame(t *testing.T) {
	var floor *Floor
	essentials.Must(json.Unmarshal([]byte(connectorFloorData), &floor))
	raster := NewRaster(floor)
	point := floor.Zone("B18").Location
	path := raster.Connect(point, point)
	if path == nil || path[0] != point || path[len(path)-1] != point {
		t.Errorf("unexpected path")
	}
}

func TestCachedConnectSame(t *testing.T) {
	var floor *Floor
	essentials.Must(json.Unmarshal([]byte(connectorFloorData), &floor))
	raster := NewRaster(floor)
	cache := NewCacheConnector(raster)
	point := floor.Zone("B18").Location
	path := cache.Connect(point, point)
	if path == nil || path[0] != point || path[len(path)-1] != point {
		t.Errorf("unexpected path")
	}
}

